} class _CounterState extends State<Counter> { int _counter = 0; get _count => _counter + widget.from; @override Widget build(BuildContext context) { return Column(children: [ Text("$_count"), IconButton( icon: const Icon(Icons.add), onPressed: () { setState(() { _counter++; }); }, ) ]); }
} En héritant de State , _CounterState a accès à la méthode setState . Cette méthode, lorsqu’elle est appelée, permet d’indiquer à Flutter qu’il faut reconstruire le state qui mute au fil du temps contrairement au widget. Les membres d’un state sont persistés à travers les différents builds. Seul le contenu de la méthode build n’y survit pas. Dans un state, il est possible d’accéder aux inputs du widget associé grâce à la propriété widget .

